const eeveeEvolutions = [
  { speciesId: 133, evoId: 134, method: "Water Stone" },   // Vaporeon
  { speciesId: 133, evoId: 135, method: "Thunder Stone" }, // Jolteon
  { speciesId: 133, evoId: 136, method: "Fire Stone" },    // Flareon
  // add Gen2+ evolutions if you want!
  { speciesId: 133, evoId: 196, method: "Leaf Stone (Gen2)" },  // Espeon (example)
  { speciesId: 133, evoId: 197, method: "Sun Stone (Gen2)" },   // Umbreon
];
function canEvolve(pokemon) {
  return !!pokemonEvolutions[pokemon.pokemon_id]
      || eeveeEvolutions.some(e => e.speciesId === pokemon.pokemon_id);
}
function evolvePokemon(pokemon, evolutionChoice = null) {
  const evo = pokemonEvolutions[pokemon.pokemon_id];
  if (evo) {
    if (window.player.stardust >= evo.candy /* use candy if separate */) {
      // subtract candy, update species
      window.player.stardust -= evo.candy;
      const newSpec = window.pokemonDB.find(p => p.pokemon_id === evo.next);
      Object.assign(pokemon, newSpec);
      applyTalentModifiers(pokemon);
      calculateCP(pokemon);
      return true;
    }
    return false;
  }

  // Eevee case
  if (evolutionChoice !== null) {
    const choice = eeveeEvolutions.find(e => e.speciesId === pokemon.pokemon_id && e.evoId === evolutionChoice);
    if (choice) {
      // require a stone item
      if (playerHasItem(choice.method)) {
        removePlayerItem(choice.method);
        const newSpec = window.pokemonDB.find(p => p.pokemon_id === choice.evoId);
        Object.assign(pokemon, newSpec);
        applyTalentModifiers(pokemon);
        calculateCP(pokemon);
        return true;
      }
    }
  }
  return false;
}
